"杀戮命令 -- Kill Command££££££命令宠物猛攻目标,使猎人驯服宠物在30秒内特殊攻击造成的伤害提高${10*4}%。宠物每次进行特殊攻击之后,这个伤害值加成就降低10%。\n该技能可以在变形下使用。",    --34026
"盒子 -- Stealth\n让你变成一个盒子。",   --284579
"定向爆炸射击 -- Aimed Explosive Shot\n投掷一个炸弹发射器对目标地区造成200+(SP*0.067)+(RAP*0.067) to 259+(SP*0.067)+(RAP*0.067)点火焰伤害。并且留下一个持续2秒的爆炸，每1秒造成伤害。\n使用爆炸射击的修正值。",   --270462
"奥术子弹 -- Arcane Bullet\n造成武器伤害的75%加上0+(SP*0.72)+(RAP*0.72)的奥术伤害。",   --274594
"火箭 -- Arrows of Fire\n你的远程攻击也会射出火焰之箭并消耗你最大法力值的2%。激活时不能回复法力值.\n[火焰之箭]:每秒造成(PL*0.4+4)+(SP*0.012)+(AP*0.0078)点火焰伤害，持续5秒，最多叠加10次。",   --281674
"冰霜之箭 -- Arrows of Frost\n你的远程攻击也会射出火焰之箭并消耗你最大法力值的1%。激活时不能回复法力值。\n[冰霜之箭]:造成(PL*0.5+5)+(SP*0.05)+(AP*0.05)冰霜伤害，并使敌人移动速度降低6%。最多堆叠5次，持续4秒。",   --281667
"女妖的哀嚎 -- Banshee's Wail\n发出可怕的哀号，击晕10名附近的敌人，并每1秒吸取(PL*5+11)+(SP*.01)+(AP*.01)点生命，持续3秒。\n这个咒语不会被抵抗。\n使用吸取生命修正值。",   --284534
"领主冲锋 -- Battle Charge\n攻击敌人，造成250%武器伤害并产生9点怒气。\n差距缩小的能力。与其他拉近距离的技能共享冷却时间。\n这个技能在变形时可以使用。\n使用冲锋的修正值。\n可以在近战范围内使用。",   --270697
"暗影道标 -- Beacon of Shadow\n标记一个友方目标成为暗影道标，当你使用暗影箭造成伤害的时候，5%的暗影箭伤害转化为治疗，治疗你的道标。当你主属性为精神的时候，提升到25%的伤害。\n一次只能标记1个友方目标，持续1800秒。",   --276960
"盲目复仇 -- Blind Revenge\n终结技，对目标及其附近的2个目标造成伤害\n1点: 1+(1*PL)+(AP*0.14) - 13+(1*PL)+(AP*0.14) 伤害.\n2点: 1+(2*PL)+(AP*0.18) - 13+(2*PL)+(AP*0.18) 伤害.\n3点: 1+(3*PL)+(AP*0.22) - 13+(3*PL)+(AP*0.32) 伤害.\n4点: 1+(4*PL)+(AP*0.36) - 13+(4*PL)+(AP*0.26) 伤害.\n5点: 1+(5*PL)+(AP*0.30) - 13+(5*PL)+(AP*0.30) 伤害.",   --276394
"血箭 -- Blood Arrow\n对目标造成90%的远程武器伤害，每1秒从目标身上转移9点生命值给施法者，持续5秒。\n使用吸取生命修正值。",   --276810
"钝刀子 -- Blurred Blade\n需要[单持单手武器]\n当钝刀子激活时，招架立刻进行一次攻击，但是持续时间减少1秒。\n终结技，提升攻击速度10%，并且减少8%的魔法伤害，根据连击点来持续时间。\n1点:9秒.\n2点:12秒.\n3点:15秒.\n4点:18秒.\n5点:21秒.",   --277020
"屠杀化身 -- Carnage Incarnate\n用骨头和鲜血包裹你，使你受到的物理伤害减少10%，每秒治疗PL*1.5+1，并且对周围的目标造成PL*7+2 to PL*7+40每秒伤害。\n持续4秒，在熊形态下，持续时间翻倍。",   --276203
"生生不息 -- Circle of Life\n制造一个快速的光晕并且呈现圆形扩散，治疗30码范围内的10名队友， 造成(141)+(Heal*0.20735)+(AP*0.041) to (163)+(Heal*0.20735)+(AP*0.041)的治疗量。离目标越近，治疗效果越强。\n使用光晕的修正值。",   --271484
"复合射击 -- Compound Shot\n射击目标，减少其受到的治疗40%，持续6秒。根据连击点造成武器伤害，每点连击点附带额外RAP*0.20+2伤害:\n1点:240%武器伤害.\n2点:295% weapon damage.\n3点: 350% weapon damage.\n4点:405% weapon damage.\n5点:460% weapon damage.\n这个技能可以在3秒内重复释放，进行连击。\n使用瞄准射击的修正值。",   --275320
"可控风暴 -- Controlled Storm\n恢复20%法力值，并且对你周围的目标造成800到912点伤害。使你获得可控风暴。\n[可控风暴]:使你的闪电箭，闪电链的暴击几率增加15%。持续10秒。",   --283709
"血色冠军（格挡） -- Crimson Champion\n增加你的格挡几率10%，格挡时对攻击者造成((PL-40)*2.2+2)+(SP*0.045)+(AP*0.045)神圣伤害。\n使用神圣之盾的修正值，这个效果每秒只会触发1次。",   --273522
"神圣注能 -- Divine Infusion\n使一名友方目标获得神圣力量，减少其受到的伤害40%，持续8秒内给予其60%的敌人驱散抗性。击倒附近玩家并使附近敌人的移动速度降低40%，持续2秒。",   --286266
"巨龙冲锋 -- Dragon Charge\n以提高0%的速度奔跑，直到你冲击一个敌人，持续2秒。冲击在你面前释放一个火焰锥，造成(PL*3+5)+(SP*0.1)+(AP*0.1)火焰伤害，并使敌人减速60%，持续3秒。\n对永久免疫减速效果的敌人造成300%的伤害。\n使用拦截的修正值，与其他拉进距离的技能共享冷却。",   --271897
"巨龙咆哮 -- Dragon Roar\n爆炸性咆哮，对附近的敌人造成(PL*2.4+2)+(SP*0.72)+(AP*0.72)穿甲物理伤害，并使其移动速度降低60%，持续2秒。\n这个技能在变形时可以使用。",   --271895
"恐怖武器 -- Eldritch Weapon\n使你的主手武器充满邪术之力，使所有威胁增加20%，并使你的近战技能触发一波高威胁奥术伤害，恢复你已经损失的2%法力值。\n恐怖武器只能每5秒触发一次，并且不会与其他临时武器附魔叠加。",   --270033
"神圣裁决 -- Exorcist's Slash\n攻击目标，造成260%武器伤害，并获得以下恩赐之一:\n-神圣风暴的冷却时间减少5秒\n-审判的冷却时间减少5秒\n-十字军打击恢复1次充能。\n使用驱邪术的修正值，如果你已经学习战斗的圣洁和正义复仇天赋，那么将会被触发。",   --285566
"精灵闪现 -- Faerie Blink\n传送施法者向前10码，除非有东西挡道，并释放精灵齐射，没有办法解除控制效果。\n使用闪现的修正值，并与其他闪烁法术共享8秒冷却时间。\n[精灵齐射]:精灵凌空抽射向附近5个目标发射一连串精灵飞弹，造成96 - 128点奥术伤害，每击中一个目标使精灵闪现的冷却时间缩短2秒。",   --282949
"刀扇 -- Fan of Knives\n释放技能投掷武器造成伤害，如果使用的匕首则造成PL*1+40*1.5%的武器伤害，如果使用其他武器则造成PL*1+40%的武器伤害.\n施放此法术使其能量消耗增加3点，持续8秒。",   --270147
"邪能武器 -- Fel Infused Weapon\n给你的武器注入邪能火焰，使你的近战技能造成额外的((PL-10)*3+5)+(AP*0.2)+(SP*0.2)暗影火焰伤害。\n不会从取代你的自动攻击的技能中触发。不与其他临时武器附魔叠加。",   --276076
"火焰星瀑 -- Firefall\n撞击造成112 - 127点火焰伤害，然后爆炸，对5码内的敌人额外造成20点火焰伤害。效果持续8秒，在你周围20码范围内召唤最多16颗星星。\n最后一颗星可以让你获得法术连击效果。\n使用星落术修正值。\n当你变形、失去角色控制或坐骑时取消。\n[法术连击]:使你下一个炎爆术瞬发。",   --284677
"禁忌招式 -- Forbidden Technique\n瞬间射击，造成230%的远程武器伤害。使用此技能将你传送到目标身边，留下你的影子并赋予你暗影之舞的能力。\n当暗影之舞结束时，你传送回你的影子。",   --271981
"火焰星瀑 -- Frostfall\n从空中释放一连串冰霜之星，每次造成112 - 127点冰霜伤害，然后爆炸，对5码内的敌人额外造成20点冰霜伤害。效果持续8秒，在你周围20码范围内召唤最多16颗星星。\n最后一颗星赐予你寒冰指。\n使用星落术修正值。\n当你变形、失去角色控制或坐骑时取消。\n[寒冰指]:你的法术将目标视为冰冻状态,持续15秒。",   --284664
"锤子风暴 -- Hammerstorm\n神圣之锤包围你，每秒对周围的敌人造成(PL*1+23)+(SP*0.05)+(AP*0.05)神圣伤害，使你的力量提高5%，提高你100%的力量值的护甲。持续6秒。\n你可以无视目标生命值，使用愤怒之锤",   --285444
"仇恨打击 -- Hateful Strike\n致命一击，造成100%武器伤害+ 85伤害。有极短的公共冷却时间。\n只有你进入仇恨状态才可以使用，当你使用战士的技能有机会让你进入仇恨状态。\n使用致死打击的修正值，无法减少技能的冷却时间和产生仇恨状态。\n[仇恨]:获得仇恨状态，并且获得沸腾增长，允许使用仇恨打击，可叠加6次，持续12秒\n[沸腾增长]:获得1%的力量加成，最多叠加10层，持续10秒。叠加至最大层数后，不可被刷新。",   --276123
"超级神圣新星 -- Holy Supernova\n使施法者周围产生圣光爆炸，对10码内所有敌方目标造成47+(SP*0.3013)+(AP*0.1958)至55+(SP*0.3013)+(AP*0.1958)神圣伤害，并治疗10码内最多10名团队和团队成员(33)+(治疗*0.3787)+(AP*0.076)，立即清除他们身上的一个负面效果。\n这些效果不会造成威胁。使用神圣新星修正值。",   --270182
"冰霜冲击 -- Ice Shock\n终结技，使用冰霜冲击目标，立即造成连击点数相关的冰霜伤害，并且造成一个持续6秒的持续伤害:\n1点: 5+15*1+(SP*0.01)*1*1+(SP*0.06)+(AP*0.01)*1*1+(AP*0.06)-10+15*1+(SP*0.01)*1*1+(SP*0.06)+(AP*0.06)*1*1+(AP*0.01) 冰霜伤害和2+1*1+(SP*0.003)*1*1+(SP*0.03)+(AP*0.003)*1*1+(AP*0.03) 每0秒持续伤害。\n2点: 5+15*2+(SP*0.01)*2*2+(SP*0.06)+(AP*0.01)*2*2+(AP*0.06)-10+15*1+(SP*0.01)*2*2+(SP*0.06)+(AP*0.06)*2*2+(AP*0.01)冰霜伤害和2+1*1+(SP*0.003)*2*2+(SP*0.03)+(AP*0.003)*2*2+(AP*0.03) 每0秒持续伤害。\n3点:5+15*3+(SP*0.01)*3*3+(SP*0.06)+(AP*0.01)*3*3+(AP*0.06)-10+15*1+(SP*0.01)*3*3+(SP*0.06)+(AP*0.06)*3*3+(AP*0.01)冰霜伤害和2+1*1+(SP*0.003)*3*3+(SP*0.03)+(AP*0.003)*3*3+(AP*0.03)每0秒持续伤害。\n4点: 5+15*4+(SP*0.01)*4*4+(SP*0.06)+(AP*0.01)*4*4+(AP*0.06)-10+15*1+(SP*0.01)*4*4+(SP*0.06)+(AP*0.06)*4*4+(AP*0.01)冰霜伤害2+1*1+(SP*0.003)*4*4+(SP*0.03)+(AP*0.003)*4*4+(AP*0.03)每0秒持续伤害。\n5点: 5+15*5+(SP*0.01)*5*5+(SP*0.06)+(AP*0.01)*5*5+(AP*0.06)-10+15*1+(SP*0.01)*5*5+(SP*0.06)+(AP*0.06)*5*5+(AP*0.01)冰霜伤害和2+1*1+(SP*0.003)*5*5+(SP*0.03)+(AP*0.003)*5*5+(AP*0.03)每0秒持续伤害。\n这个技能和萨满的震击技能共享冷却，然后每次冰霜冲击伤害都会回复5点能量值。\n使用冰霜震击的修正值。\n后续周期性伤害可以暴击，并且受到法术急速加成。\n",   --274680
"遁入暗影 -- Into Darkness\n你消失在黑暗中，进入潜行模式，并获得一个吸收盾，吸收周期性的伤害。持续10秒。\n使用消失修正值，使用时移除无懈可击。",   --283896
"骑士星落 -- Knightfall\n当技能激活时，剔骨会使一连串的星星从天而降，落在8码内的所有敌人身上，每消耗一个连击点，持续0.6秒。\n使用星落术修正值。",   --274523
"雷霆战刃 -- Lightning Blade\n立即攻击你的目标，造成主手武器伤害的200% + 1+0.1*(AP+SP)，并使目标从你的雷霆一击中受到的伤害提高150%，持续6秒。最多3次充能。每层充能20秒。\n过载迅刃会回复一次层数。\n使用风暴打击修正值。",   --275047
"彻底疯狂 -- Mass Hysteria\n恐惧你8码范围内的所有敌人，持续10秒，使他们疯狂逃窜。\n使用恐惧修正值。\n玩家持续6秒，可能会被伤害打断。",   --281702
"日蚀预兆 -- Oracle of the Eclipse\n重置神圣震击或者激流的冷却时间，并使你的下一个神圣震级或激流释放能量，治疗6个附近的盟友。\n最多1层充能。15秒的充能冷却。激活时消耗月之祝福。\n不会触发公共冷却。",   --275269
"炫耀 -- Panache\n终结技，每点连击点减少错开0.6的冷却时间，并且对8码内的所有敌人造成伤害。\n1点：2+((5*1)+(AP*0.01)+SP*0.01) - 6+((5*1)+(AP*0.01)+SP*0.01)伤害\n2点：2+((5*2)+(AP*0.04)+SP*0.04) - 6+((5*2)+(AP*0.04)+SP*0.04)伤害\n3点：2+((5*3)+(AP*0.09)+SP*0.09) - 6+((5*3)+(AP*0.09)+SP*0.09)伤害\n4点：2+((5*4)+(AP*0.16)*1)+SP*0.16)*1 - 6+((5*4)+(AP*0.16)+SP*0.16)伤害\n5点：2+((5*5)+(AP*0.25)*1)+SP*0.25)*1 - 6+((5*4)+(AP*0.25)+SP*0.25)伤害\n使用剔骨的修正值。",   --277021
"伞兵 -- Paratrooper\n将你直接向上发射并激活战斗降落伞。\n使用后跳的修正值。\n[战斗降落伞]:在空降时展开战斗降落伞。降低坠落速度，增加猎人射击暴击几率50%，轨道箭击伤害50%。",   --272136
"保存祈祷 -- Prayer of Preservation\n一个强大的祈祷，在3秒内治疗8码内的5名队友，持续治疗((63)+(Heal*0.04823)+(AP*0.01))*3.7。这个技能的最终治疗效果提高70%\n使用治疗祷言的修正值。",   --276250
"心灵爆炸 -- Psychic Barrage\n在10码范围内释放心灵爆炸，造成44 - 50点暗影伤害，并使被击中的敌人在恐惧中逃跑，持续5秒。\n恐惧嚎叫和心灵震爆的修正值。",   --282263
"原生混乱 -- Pure Chaos Bolt\n向敌人发射一道混乱魔法，造成964+(SP*0.4742)+(AP*0.3082)到1233+(SP*0.4742)+(AP*0.3082)混乱伤害，并驱散玩家对目标施放的吸收。无法抵抗，绕过吸收、偏转和反射效果。\n使用混乱箭修正值。",   --272774
"暗影射击 -- Shadow Arrow\n造成120%的远程武器伤害外加44点持续暗影伤害，持续12秒。给予你暗影冥想状态，可以在移动时施放。\n使用腐蚀术修正值。\n[暗影冥想]:使你的下一个暗影箭或者腐蚀之种瞬发，并且减少25%蓝耗。",   --276811
"暗影炮击 -- Shadow Artillery\n在目标位置发射暗影炮弹，对附近的敌人造成(PL*3.5+10)+(SP*0.45)+(AP*0.45)直接暗影伤害和额外的（PL*1.3+7)+(SP*0.05)持续暗影伤害，持续3秒。施放时恢复35%的基础法力值。\n最多1次充能。45秒充能冷却。消耗3个暗影甲壳而不是充能。\n当击中5个以上目标时，伤害将被分摊。",   --276816
"暗影反击 -- Shadow Counter\n将你包围在阴影中，使你免疫人群控制，击退，沉默和中断效果2秒。\n受到玩家的直接伤害，吸收当次伤害，使你暗影步攻击者。\n最多1次充能。45秒充能冷却。消耗3个暗影甲壳而不是充能。\n此技能使用暗影步修正，并与其他接近距离的技能共享冷却时间。",   --273990
"暗影星瀑 -- Shadowfall\n从天空中释放一阵黑暗之星，每次冲击造成112 - 127点暗影伤害，然后对5码内的敌人额外造成20点暗影伤害。效果持续8秒，在你周围20码范围内召唤最多16颗星星。\n最后一颗星可以让你获得暗影冥想效果。\n使用星落术修正值。\n当你变形、失去角色控制或坐骑时取消。\n[暗影冥想]:你的下一个暗影箭或腐化之种是瞬发的，消耗的法力值减少25%。",   --284650
