"斯巴达脚踢 -- Spartan Kick\n强力一脚，击退目标并造成(PL*3+4)+(SP*0.5)+(AP*0.5)物理伤害。\n这就是,斯巴达！",   --282273
"森林之魂 -- Spirit of the Forest\n为你注入森林之魂20秒，减少野性生长的冷却时间50%，生命绽放的法力消耗50%，并使你的回春现在也能立即治疗你的盟友，效果为(PL*1+1)+(SP*0.225)+(AP*0.045)。",   --283800
