"潮汐之盾 -- Tidal Shield\n治疗一个盟友83+0.274*heal到94+0.274*heal，并生成50%治疗量的吸收护盾。额外的施法会增加你的盟友最大生命值的35%。\n最多充能5次，20秒的充能时间，忏悔打击会给与1次使用次数.\n使用次级治疗波的修正值，治疗完毕后给与10%的吸收。",   --274920
"时间隧道 -- Time Warp\n将你送回活动的时空异常。虽然你知道这个法术闪烁会留下一个时间异常。",   --272171
