"狼人形态 -- Worgen Form\n变成狼人，可以使用猫形态和暗影牧师技能。\n暗影术:痛、噬灵瘟疫和吸血鬼之触可以受到急速加成。\n直接暗影伤害使戈德林之怒的冷却时间缩短1秒，心灵鞭笞的攻击使其冷却时间缩短2秒。\n如果你的主要属性是敏捷或力量，变形为狼人形态将使你免受所有影响移动的效果。",   --275737
"幽魂打击 -- Wraith\n终结技，造成持续伤害，如果技能被驱散或者结束后，将100%的伤害量，治疗你，连击点影响伤害。\n使用鬼影缠身修正值。",   --284732
