"焦点 -- Focal Point\n当你的焦点对你产生致命一击时，你获得焦点。\n[焦点]：增加使用法术的暴击几率2%，最多叠加3次，持续5秒。",   --284393
"狂乱横扫 -- Frenzied Swipe\n扫过目标及附近的敌人，造成300%武器伤害，并让你的驯养宠物陷入狂热状态，使其自动攻击打击最多5名附近的敌人，持续8秒。横扫效果受到横扫修正值的影响。驯养宠物包括召唤恶魔、奴役恶魔、掌控亡灵、驯服龙类或束缚元素，以及驯服野兽。",   --284155
"冰霜冲击 -- Frost Blast\n对目标施放寒冰震击，造成(78)+(SP*0.3162)+(AP*0.2055)点冰霜伤害，并减少寒冰护体的冷却时间3秒。可在移动中施放。\n此技能与萨满的震击技能共用冷却时间。\n这使用了冰霜震击的修正值。",   --276009
"冰霜炸弹 -- Frost Bomb\n应用冰霜炸弹，爆炸后6秒或被驱散时释放寒霜波，对附近敌人造成(PL*7+3)+(SP*0.7)+(AP*0.455)点冰霜伤害，并使其移动速度减缓60%。\n触发快速冻结天赋，并受益于冷若冰霜天赋的冷却时间减少。\n无法被反射。",   --271936
"霜火震击 -- Frostflame Shock\n震击目标及2名附近的敌人，造成26+(SP*0.1355)+(AP*0.1016)点冰霜之火伤害，并在接下来的12秒内每3秒额外造成9+(SP*0.069)+(AP*0.0448)点冰霜之火伤害。这使用了火焰震击的修正值。周期性伤害可以暴击，受法术急速影响，可以触发寒冰之指。",   --272429
"冰冻意志 -- Frozen Mind\n你的思维被冻结。受到致命的物理伤害有机会阻止攻击者在5秒内造成致命一击。增加相当于你智力的250%的护甲，但生命值减少5%。\n不能与姿态或形态一同使用。\n此效果每15秒只能发生一次。",   --283934
"烈火 -- Fuego\n释放原生火焰，造成131+2.85*(PL-20)+0.39*AP+0.6*SP的火焰伤害，并在12秒内额外造成164+(PL-20)+0.0214*AP+0.033*SP4的火焰伤害。\n这使用了炎爆术的修正值，并共用冷却时间。",   --276742
"极光之火 -- Glacial Fire\n用极光之火冲击目标，造成140到178点神圣冰霜伤害，并在7秒内额外造成21点神圣冰霜伤害。在燃烧状态下，目标的周期性治疗和吸收效果降低30%。\n这使用神圣之火的修正值，并受益于碎冰和寒冰之指。",   --285869
"戈德林之怒 -- Goldrinn's Fury\n增加你对暗影伤害的输出15%，使用猎豹形态技能造成伤害会施加阿鲁高的馈赠。[阿鲁高的馈赠]：在6秒内造成(PL*1*3+7*3)+(AP*0.08*3)+(SP*0.08*3)点暗影打击伤害，最多叠加3次。",   --275739
"葡萄弹射击 -- Grape Shot\n需要枪械\n需要单持单手武器\n终结技，每点连击点对你面前的5名敌人造成武器伤害：\n1点：6+26*1+(SP*0.0008)*1*1+(RAP*0.0008)*1*1-59+26*1+(SP*0.0008)*1*1+(RAP*0.0008)*1*1物理伤害；\n2点：6+26*2+(SP*0.0008)*2*2+(RAP*0.0008)*2*2-59+26*2+(SP*0.0008)*2*2+(RAP*0.0008)*2*2物理伤害；\n3点：6+26*3+(SP*0.0008)*3*3+(RAP*0.0008)*3*3-59+26*3+(SP*0.0008)*3*3+(RAP*0.0008)*3*3物理伤害；\n4点：6+26*4+(SP*0.0008)*4*4+(RAP*0.0008)*4*4-59+26*4+(SP*0.0008)*4*4+(RAP*0.0008)*4*4物理伤害；\n5点：6+26*5+(SP*0.0008)*5*5+(RAP*0.0008)*5*5-59+26*5+(SP*0.0008)*5*5+(RAP*0.0008)*5*5物理伤害。\n这使用了多重射击的修正值。此技能的冷却时间无法减少。",   --276634
"黑暗之握 -- Grasp of Darkness\n引导黑暗能量，每隔3秒造成(PL*15.5*3+10*3)+(AP*0.5*3)+(SP*1.4*3)点暗影伤害。通过每个受控的上古之神触手通道力量，使伤害提高25%，暴击几率提高15%。",   --272954
"附着之根 -- Grasping Roots\n向前发射附着之根，使其定住并造成(PL*4+1)+(SP*0.2)+(AP*0.13)点自然伤害。当根须收缩时，将根须定住的敌人拉回到你原始位置。\n可以在变形状态下使用。",   --283493
"大地之怒 -- Ground Slam\n猛击地面，释放一波毁灭性的地狱尖刺，对10个附近的敌人造成((PL-34)*10+152)+(AP*1)+(SP*1)到((PL-34)*10+198)+(AP*1)+(SP*1)点物理伤害。\n这使用了裂地术的修正值。",   --276115
"古拉巴什之怒 -- Gurubashi Rage\n变得狂暴，由造成伤害所获得的所有怒气值提高50%，并增加近战技能的暴击几率10%，持续12秒。\n可以在变形状态下使用。\n这使用了鲁莽的修正值。",   --275915
"地狱咆哮 -- Hell Scream\n发出地狱般的呐喊，使8码范围内的5名敌人在接下来的12秒内流血，每3秒受到(PL*1.7+19)+(SP*0.045)+(AP*0.045)伤害。\n此伤害使用了撕裂的修正值。",   --285693
"审判时刻 -- Hour of Judgement\n引导10秒，每2秒对10码范围内的敌人造成((PL-30)*2+21)+(SP*0.05)+(AP*0.05)点神圣伤害，并每0.5秒释放一次来自天堂的锤子。天堂的锤子：从天堂落下的神圣锤子，对附近敌人造成((PL-30)*1+2)+(AP*0.07)+(SP*0.07)到((PL-30)*1+21)+(AP*0.07)+(SP*0.07)点神圣伤害。",   --282984
"飓风打击 -- Hurricane Strike\n立即使用双武器打击，造成(PL*2+37)+(AP*0.9)+(SP*0.9)到(PL*2+51)+(AP*0.9)+(SP*0.9)点物理伤害。获得飓风之刃的能力可以使用一次。你的近战命中有20%的几率获得飓风之刃。\n这使用了飓风的修正值。每6秒只能获得一次飓风之刃。",   --274821
"冰河世纪 -- Ice Age\n对附近敌人造成(PL*2+22)+(SP*0.0965)+(AP*0.0627)点冰霜伤害，使其冻结最多4秒。对目标造成的伤害会中断冻结效果。冰河世纪无法被驱散。\n这使用了冰霜新星的修正值。",   --281696
"标枪 -- Javelin\n需要矛\n刺穿目标，造成35+(SP*0.11)+(AP*0.35)点穿甲伤害，并使其每1秒流血2+(SP*0.16)+(AP*0.16)点物理伤害，持续12秒。\n这使用了英勇打击的修正值。流血效果不使用修正值。",   --274278
"熔岩扫击 -- Lava Sweep\n需要长柄武器，法杖，双手斧，双手锤，双手剑\n释放熔岩扫击，对你你面前的敌人造成120%主手武器伤害。如果你的武器附有火舌，对主要目标的伤害增加120%。\n这使用了熔岩猛击的修正值。",   --271579
"正义之光 -- Light of Justice\n晕眩目标5秒，但降低目标所受伤害50%。\n圣光涌动使其瞬发。\n这使用了制裁之锤的修正值。",   --283959
"雷云 -- Lightning Cloud\n创造一片雷云，轰击区域内的敌人，造成(34)+(SP*0.0855)+(AP*0.0641)点自然伤害，每2秒额外造成(353)+(SP*0.0855)+(AP*0.0556)点自然伤害，持续8秒。\n这受到雷霆风暴的修正值影响。",   --285699
"活体闪电 -- Living Lightning\n需要主属性：精神\n治疗一个盟友213到240点生命值，然后跳到更多附近的目标，最终形成一道闪电链打击。每跳一次，治疗效果降低40%。共治疗3个目标。\n这使用了治疗链的修正值。",   --271153
"蝗灾射击 -- Locust Shot\n需要远程武器。发射一发造成70%武器伤害的自然伤害子弹。可在移动时施放。使用稳固射击的修正值。",   --271745
"群体减速 -- Mass Slow\n减缓目标及10码范围内所有敌人的移动速度40%，增加其远程攻击间隔30%，施法时间延长15%。持续10秒。不叠加其他类似效果。",   --281627
"巨霜 -- Megafrost\n结束技，对施法者周围的敌人造成冰霜伤害并每连击点冻结敌人：1点：16+((8*1)+0.03*SP)伤害，冻结1秒。2点：16+((8*2)+0.03*SP)伤害，冻结2秒。3点：16+((8*3)+0.03*SP)伤害，冻结3秒。4点：16+((8*4)+0.03*SP)伤害，冻结4秒。5点：16+((8*5)+0.03*SP)伤害，冻结5秒。\n使用冰霜新星的修正值。寒冰指天赋将允许在没有连击点的情况下施放。",   --284822
"熔岩意志 -- Molten Mind\n你的思绪变得炽热，增加治疗和法术暴击的暴击伤害加成5%，降低威胁，但增加法术的法力消耗3%。不可与其他改变状态栏的能力同时使用，如姿态或形态。",   --284429
"噩梦根须 -- Nightmare Roots\n召唤一片迷雾，使噩梦之根在3秒后击中目标，造成36点暗影打击伤害。\n使用纠缠根的修正值。",   --282958
"敏锐思维 -- Nimble Mind\n你的思绪变得灵活，增加法术急速5%，减少法术的法力消耗10%，但增加受到的伤害5%。\n不可与其他改变状态栏的能力同时使用，如姿态或形态。",   --284442
"凶险之痛 -- Perilous Pain\n对敌人目标造成50到59点火焰伤害，制造大量威胁。此法术可在移动时施放。\n使用灼热之痛的修正值。",   --286372
"剧毒炸弹 -- Poison Bomb\n投掷一个剧毒炸弹，释放致命毒雾，立即对目标附加2层致命毒药，并在接下来的6秒内每2秒对附近敌人额外附加一层。",   --284169
"刺穿 -- Puncture\n需要猎豹形态\n毒害目标，造成(22)+(SP*0.09)+(AP*0.09)风暴打击伤害，并在接下来的9秒内额外造成((22)+(SP*0.11)+(AP*0.11))*3风暴打击伤害。奖励1连击点。\n使用斜掠的修正值。",   --275662
"拉扎什之爪 -- Razzashi Talon\n需要匕首\n立即用两把武器进行攻击，造成145%武器伤害，加上每层在目标身上施加的流血效果，每层增加5%。不授予连击点。\n使用毁伤的修正值。",   --275861
"腐烂吐息 -- Rotting Breath\n对你前方锥形范围内的敌人造成425到494点瘟疫伤害，并施加腐烂效果。此技能可在变形状态下使用。使用龙息的修正值。\n[腐烂]\n每3秒造成伤害，并使你对目标的物理伤害提高8%，持续9秒。",   --282930
"焦土 -- Scorched Earth\n灼热你的目标，造成98到116点火焰伤害。可在移动时施放。\n使用灼烧的修正值。",   --286356
"往日尖啸 -- Screams of the Past\n释放往日尖啸，对附近的敌人造成心灵创伤并使其逃离3秒。这使用“心灵尖啸”的修正值。\n[心灵创伤]:每2秒造成(PL*2.8+11)+(AP*0.065)+(SP*0.1)暗影伤害，持续10秒。心灵震爆刷新持续时间。",   --284547
"蛇人形态 -- Serpent Form\n变身为蛇人，允许使用猎豹形态技能，使你的自动攻击也造成毒性打击，额外造成(PL*0.18+9)+(SP*0.039375)+(AP*0.039375)自然伤害。\n此技能使用猎豹形态的修正值，毒性打击使用速效毒药的修正值。\n如果你的主属性是敏捷或力量，变形成蛇人形态将解除所有移动限制效果。",   --275656
"蛇击 -- Serpent Strike\n打击敌人，造成27点伤害并授予你毒蛇打击。授予1连击点。使用爪击的修正值。\n[毒蛇打击]:增加1%速效毒药伤害和2%致命毒药伤害。叠加最多10次，持续10秒。",   --275655
"蛇毒 -- Serpent Venom\n终结技，对目标进行毒害，根据连击点数造成风暴打击伤害： \n1点：在12秒内造成（3+4*1+0.01*AP）×6伤害。\n2点：在12秒内造成（3+4*2+0.02*AP）×6伤害。\n3点：在12秒内造成（3+4*3+0.03*AP）×6伤害。\n4点：在12秒内造成（3+4*4+0.04*AP）×6伤害。\n5点：在12秒内造成（3+4*5+0.05*AP）×6伤害。 \n使用了撕扯的修正值。",   --275658
"盾牌打击 -- Shield Strike\n需要盾牌\n用盾牌猛击目标，根据连击点造成伤害并减少血性狂暴的冷却时间：\n1点：1+170*1+1*1*(SP*0.016)+(AP*0.016)*1*1伤害；\n2点：1+170*2+2*2*(SP*0.016)+(AP*0.016)*2*2伤害；\n3点：1+170*3+3*3*(SP*0.016)+(AP*0.016)*33伤害；\n4点：1+170*4+4*4*(SP*0.016)+(AP*0.016)*44伤害；\n5点：1+170*5+5*5*(SP*0.016)+(AP*0.016)*55伤害。\n使用盾牌猛击的修正值。",   --274264
"寂静书库 -- Silence in the Library\n向目标投掷一本书，造成((PL-16)*6+126)+(SP*1)+(AP*1)物理伤害，打断其施法并使其沉默5秒。此技能与其他打断技能共享冷却时间。",   --285938
"日耀攻击 -- Solar Strike\n需要近战武器\n终结技，利用日耀灼烧目标，按照连击点造成星界伤害：\n1点：2+0*1+(SP*0.025)*1*1+(AP*0.017)*1*1-4+0*1+(SP*0.025)*1*1+(AP*0.017)*1*1伤害；\n2点：2+0*2+(SP*0.025)*2*2+(AP*0.017)*2*2-4+0；\n3点：2+0*3+(SP*0.025)*3*3+(AP*0.017)*3*3-4+0*3+(SP*0.025)*3*3+(AP*0.017)*3*3伤害；\n4点：2+0*4+(SP*0.025)*4*4+(AP*0.017)*4*4-4+0*4+(SP*0.025)*4*4+(AP*0.017)*4*4伤害；\n5点：2+0*5+(SP*0.025)*5*5+(AP*0.017)*5*5-4+0*5+(SP*0.025)*5*5+(AP*0.017)*5*5伤害。\n使用剔骨的修正值。\n[日耀]：每3秒造成(PL*2.675+1)+(SP*0.25522))+(AP*0.25522))星界伤害，持续9秒。这使用月火术的修正值",   --274515
"惊叫 -- Staggering Shout\n使半径10码范围内的所有敌人定身3秒。造成伤害可能打断效果。",   --283412
"星之子 -- Starborn\n立即获得深冬之寒的最大层数，并在7秒内增加你的火球术、霜火箭、极寒和烈火的暴击几率100%。\n使用燃烧的修正值。",   --276736
"星爆 -- Starburst\n在区域内迅速施放奥术爆破，每0.5秒造成(19)+(SP*0.1228)+(AP*0.0798)奥术伤害。施放伤害法术会增加通道持续时间，每次增加0.5秒，最多增加1.5秒。\n使用魔爆术的修正值。",   --284221
"风暴锤 -- Stormhammer\n投掷一把闪电注入的锤子，造成((PL-29)*6+195)+(SP*0.5)+(AP*0.325)自然伤害。产生大量威胁。\n使用震荡猛击的修正值。",   --273955
"召唤虚空之域 -- Summon Void Zone\n在目标位置召唤虚空之域，造成154到206点暗影伤害，并使半径4码范围内的敌人受到额外5%的暗影伤害。",   --282977
"日炎术 -- Sunfire\n燃烧你的目标，每3秒造成11+(SP*0.0845)+(AP*0.0549)奥术火焰伤害，持续15秒，并对8码范围内的敌人造成15+(SP*0.053)+(AP*0.0397)奥术火焰伤害。\n使用月火术的修正值。",   --283815
"同步 -- Synchronize\n每秒治疗所有附近，或者时间捆绑的盟友，治疗4秒。在施放时，时间停滞，冻结你激活的结盟增益的持续时间。\n如果已学习扭曲时空或不朽则消耗70能量。使用奥术飞弹的修正值。",   --276345
"时光冲击 -- Temporal Blast\n用能量轰击你的目标，造成3+12.6*PL+0.2655*AP+0.4085*SP奥术伤害。如果时光冲击在完成前被取消，所投入的时间将减少下一个时光冲击的施放时间。\n使用奥术冲击的修正值。",   --274026
"投掷武器 -- Throw Weapon\n需要武器\n投掷你的武器，造成100%武器伤害并使目标昏迷1秒。你被缴械2秒。",   --282329
"雷霆毛皮 -- Thunder Hide\n施法者的毛皮变得充满电荷。受到法术、近战或远程攻击时，攻击者会受到16自然伤害。这会消耗一层雷霆毛皮，持续10分钟。使用闪电护盾的修正值，每3秒只能发生一次。",   --277080
"定时炸弹 -- Time Bomb\n对敌人施放一个定时炸弹，储存你对目标造成的奥术伤害的50%，并在10秒后引爆。",   --284591
"泰坦毁伤 -- Titanic Mutilate\n需要单手斧，单手锤，单手剑，双手斧，双手锤，双手剑\n同时使用两把武器攻击，造成110%武器伤害。对流血目标的伤害提高20%。奖励0连击点数。\n这使用了毁伤修正值。",   --271779
"泰坦打击 -- Titanic Strike\n强力攻击，使用两把武器同时攻击敌人，造成武器伤害。根据连击点数决定伤害：\n1点：60%武器伤害；\n2点：90%武器伤害；\n3点：120%武器伤害；\n4点：150%武器伤害；\n5点：180%武器伤害。\n提升10%你下个战士技能对玩家的伤害。",   --273668
"扭曲心灵 -- Twisted Mind\n扭曲你的思想，使你的法术强度提高PL * 1，命中率提高3%，但减少5%的治疗和吸收。\n这个技能不能与其他姿态或形态一起使用。",   --284448
"邪能释放 -- Unleash Fel Energy\n召唤一股邪能洪流，持续10秒。站在洪流中会导致你的法术和技能造成(PL*3.2+2)+(SP*0.15)+(AP*0.11)额外混乱伤害。\n邪恶能量重置此技能冷却时间。\n此技能在变形时可用。",   --271083
"无情之怒 -- Unrelenting Wrath\n让你驯服的宠物进入愤怒状态，持续8秒，造成30%的额外伤害，减少15%的威胁，并重置你的狂乱射击的冷却时间。\n最多2次充能。2分钟充能冷却时间。狂野突袭可以恢复充能。\n驯服宠物包括召唤恶魔、奴役恶魔、支配亡灵、驯服龙类或元素束缚、驯服野兽。",   --272318
"不稳定唤醒 -- Unstable Evocation\n在引导时，你免疫中断，沉默和眩晕，并在3秒内获得总法力值的15%。完成不稳定唤醒后，附近的敌人受到(PL*3+53)+(SP*0)+(AP*0)奥术伤害并被击退。\n使用唤醒的修正值。",   --284298
"吸血鬼领主 -- Vampire Lord\n接受吸血鬼领主的力量，由你造成的2.5%直接暗影伤害和1%周期性暗影伤害，将治疗你和附近的盟友，。\n这个治疗量在主属性为精神时加倍，并从你的治疗强度中获益。\n当吸血鬼之拥抱激活时，额外获得2%的直接伤害和1%的周期性伤害转化为治疗。\n使用吸血鬼的拥抱加值。\n多目标法术触发一次治疗。",   --276959
"剧毒之怒 -- Venomous Fury\n终结技，消耗的每个连击点对目标和你前方最多5个敌人造成风暴打击伤害：\n1点：8+23*1+0.0048*AP+0.0048*NatP-15+23*1+0.0048*AP+0.0048*NatP 伤害；\n2点：8+23*2+0.0096*AP+0.0096*NatP-15+23*2+0.0096*AP+0.0096*NatP 伤害；\n3点：8+23*3+0.0144*AP+0.0144*NatP-15+23*3+0.0144*AP+0.0144*NatP 伤害；\n4点：8+23*4+0.0192*AP+0.0192*NatP-15+23*4+0.0192*AP+0.0192*NatP 伤害；\n5点：8+23*5+0.024*AP+0.024*NatP-15+23*5+0.024*AP+0.024*NatP 伤害。\n使用凶猛撕咬的修正值。",   --275659
"灭战者 -- Warbreaker\n猛踏地面，对附近的敌人造成150%的穿甲武器伤害，并使你的攻击穿透敌人30%的护甲，持续10秒。\n使用巨人打击修正值。",   --284476
"水之新星 -- Water Nova\n对区域内所有敌人造成(PL*6+14)+(AP*0.39)+(SP*0.6)至(PL*6+17)+(AP*0.39)+(SP*0.6)冰霜伤害\n使用冰霜新星的修改值，并且有一个单独的冷却时间。\n这个技能可以在变形时使用。",   --272031
"校准 -- Align\n治疗你的目标为((PL-9)*5.32+54)+(治疗*0.1072)+(AP*0.048)，持续8秒。对齐时间限制的盟友会造成额外的时间扭曲。\n如果学会时间扭曲或不朽，施放校准会消耗5点能量。\n它使用月火修饰符。",   --276343
"秘术爆炸 -- Arcanist's Explosion\n在施法者周围造成奥术魔法爆炸，对12码内所有目标造成(53)+(SP*0.1228)+(AP*0.08)奥术伤害。\n使用奥爆术修正。",   --284697
"阿塔莱图腾 -- Atal'ai Totem\n召唤一个拥有5点生命值的阿塔莱图腾在你脚下，持续1分钟，重复攻击20码内的敌人，造成11到14点自然伤害。\n此技能在变形时可用。\n使用灼热图腾的修正值，并受益于烈焰召唤天赋。",   --282905
"黑寡妇袭击 -- Black Widow Strike\n毒性攻击造成(PL*4.375+10)+(SP*0.1)+(RAP*0.1)物理伤害和额外的(PL*2+22)+(SP*0.08)+(RAP*0.026)自然伤害，每0秒造成一次，持续15秒。\n使用黑箭的修饰值。",   --286387
"骨矛 -- Bone Spear\n投掷一个刺穿护甲和抗性的骨矛，造成(PL*6+6)+(AP*0.1)+(SP*0.1)暗影打击伤害，并对敌方造成骨矛效果。最多充能2次。你的物理近战技能有一定几率产生一次充能。\n[骨矛]：每2秒造成(PL*2+3)+(AP*0.04)+(SP*0.04)伤害，你的破城者对目标造成的伤害增加10%。持续8秒，最多堆叠3个。",   --284890
"校准目标 -- Calibrate Aim\n专注于目标，调整你的瞄准目标。当你在通道中心的时候开枪（再特定的时间释放射击类技能）\n将使之后的射击增加5%的暴击伤害，并使其忽略目标10%的护甲，叠加3次，持续20秒。",   --285521
"撕裂残杀 -- Carnage Rend\n伤害目标，造成40点伤害，外加0.2*5*((MWB+ MWB)/2+AP/14*MWS)持续伤害，持续15秒。\n使用撕裂修正值。",   --276204
"腐臭群蜂 -- Carrion Swarm\n对你前方锥形范围内的敌人造成((PL-10)*5+5)+(SP*0.129)+(AP*0.129)暗影伤害，并使其治疗效果降低25%，持续10秒。\n这个技能在变形时可以使用。",   --282993
"灼烧之火 -- Cauterizing Fire\n投掷一个火焰球，对敌人造成14 - 22点火焰伤害，并在14秒内额外对敌人造成5点火焰伤害，或在14秒内对盟友造成12 - 18点治疗和7点治疗。\n使用火球术的修正值。免疫法术会阻止这种治疗，并且不会从范围增加效果中受益。",   --271205
"黑暗支配 -- Dark Domination\n使你的恶魔宠物的伤害提高30%，每2秒回复100点法力和100点生命值，持续12秒。\n使用恶魔支配的修正值。",   --285158
"黑铁地雷 -- Dark Iron Land Mine\n在地上放置一个暗铁地雷。经过地雷附近的敌方生物会使地雷爆炸，地雷是不稳定的，只能持续30秒。\n使用爆炸陷阱的修正值。\n[爆轰]:对附近的敌人造成30 - 33点火焰伤害。",   --282942
"致命后续 -- Deadly Follow-up\n立即用你的副手匕首攻击，并使用你的主手和副手的毒药两次。\n最多充能2次。16秒充能冷却时间。释放终结技时，每连击点有5%的几率恢复一次充能。\n使用毒刃修正值。",   --284128
"瓦解 -- Deconstruct\n撕裂目标的护甲，造成75%武器伤害的奥术伤害。每给你的目标加一层破甲，使你获得1秒的解构主义。\n使用毁灭打击修正。\n[解构主义]:使你的法术威力提高PL*1.2。",   --283344
"毁灭震击 -- Devastating Pound\n重击目标，粉碎他们的护甲，造成70%的物理伤害，每对目标造成3点物理伤害。你对目标施加的每一层割裂伤害增加5%。\n使用毁灭打击修正。\n[破甲]:粉碎目标的护甲，降低4%。最多叠加5次，持续30秒。不与其他类似效果叠加。",   --285770
"魔鬼火焰 -- Devil's Ignition\n对目标造成((PL-27)*5+187)+(SP*0.56904)+(AP*0.369876)火焰伤害奖励2个连击点数。\n使用烧尽的修正值。",   --274357
"吞噬心灵 -- Devour Mind\n引导一种疾病，每1秒从目标身上西区(PL*2+33*3)+(AP*0.065*3)+(SP*0.1*3)生命值，并返回15%给你，给你吞噬者效果。持续3秒，使用噬灵瘟疫修正值。\n[吞噬者]：使你下一次心灵鞭笞的伤害提高10%，最多叠加3次，持续8秒。",   --285133
"疾病之云 -- Disease Cloud\n携带者周围生成一团疾病之云，每2秒对3码内的敌人造成(PL*0.8+9)+(AP*0.08)+(SP*0.08)点瘟疫伤害，持续12秒。",   --284643
"倾盆大雨 -- Downpour\n释放一股治疗之雨，治疗区域内5名盟友，效果为(PL*3.25+47)+(治疗*0.26813)+(AP*0.054)自然治疗。",   --285269
"退潮图腾 -- Ebbing Tides Totem\n\n召唤一个5点生命值的退潮图腾，每3秒提高你对附近盟友的治疗效果8%。最多可叠加3个，持续4秒。此技能可以在变形时使用。",   --285234
"黑暗黎明 -- Ebon Dawn\n释放一股暮光能量，对10码范围内的敌人造成399+0.15*HolP+0.15*AP 至 471+0.15*HolP+0.15*AP的暮光伤害。\n这使用神圣愤怒修正值。",   --285412
"奥术愤怒 -- Eldritch Wrath\n释放一股奥术涌动，对附近的敌人造成399+(SP*0.1283)+(AP*0.1283)的奥术伤害，并降低其攻击强度4.5*PL-3。不叠加其他类似效果。\n这使用神圣愤怒修正值。攻击强度减少随玩家等级增加。",   --270034
"元素献祭 -- Elemental Immolate\n终结技，造成元素伤害，并在15秒内额外造成元素伤害。每连击点增加伤害：\n1点：1+5*1+(SP*0.006)*1*1+(AP*0.004)*1*1的伤害，以及在15秒内造成总计(0+3*1+(SP*0.003)*1*1+(AP*0.002)*1*1)*5的伤害。\n2点：1+5*2+(SP*0.006)*2*2+(AP*0.004)*2*2的伤害，以及在15秒内造成总计(0+3*2+(SP*0.003)*2*2+(AP*0.002)*2*2)*5的伤害。\n3点：1+5*3+(SP*0.006)*3*3+(AP*0.004)*3*3的伤害，以及在15秒内造成总计(0+3*3+(SP*0.003)*3*3+(AP*0.002)*3*3)*5的伤害。\n4点：1+5*4+(SP*0.006)*4*4+(AP*0.004)*4*4的伤害，以及在15秒内造成总计(0+3*4+(SP*0.003)*4*4+(AP*0.002)*4*4)*5的伤害。\n5点：1+5*5+(SP*0.006)*5*5+(AP*0.004)*5*5的伤害，以及在15秒内造成总计(0+3*5+(SP*0.003)*5*5+(AP*0.002)*5*5)*5的伤害。\n这使用献祭修正值。",   --274734
"翡翠之影 -- Emerald Visage\n召唤翡翠幼龙的影子，对敌人喷射毒气，造成(PL*5+2)+(SP*0.21)+(AP*0.21)的自然伤害，并额外造成(PL*2+2)+(SP*0.07)+(AP*0.07)的自然伤害，持续5秒。",   --285951
"能量箭 -- Energy Bolt\n对目标释放一道能量箭，造成15+(SP*0.41)+(AP*0.2665) 至 18+(SP*0.41)+(AP*0.2665)的自然伤害，并获得1连击点。\n这使用闪电箭的修正值。",   --274732
"虚无形态 -- Ethereal Form\n受到物理伤害减少5%，威胁减少10%，但受到魔法伤害增加10%。",   --282257
"凌波微步 -- Fancy Footwork\n终结技，降低附近目标对你的威胁，增加你的物理伤害，并减少来自范围效果的伤害，持续10秒。\n1点：威胁减少2%，伤害增加1%，范围伤害减少3%。\n2点：威胁减少4%，伤害增加2%，范围伤害减少6%。\n3点：威胁减少6%，伤害增加3%，范围伤害减少9%。\n4点：威胁减少8%，伤害增加4%，范围伤害减少12%。\n5点：威胁减少10%，伤害增加5%，范围伤害减少15%。\n这使用佯攻的修正值。该技能可以在猎豹形态下使用。",   --283786
"邪能顺劈斩 -- Fel Cleave\n需要长柄武器，法杖，双手斧，双手锤，双手剑\n对目标造成100%武器伤害的暗影烈焰伤害，同时打击4个附近目标，造成60%的伤害。\n释放火焰和暗影法术会减少邪能顺劈斩的冷却时间2秒。\n这使用顺劈斩的修正值。",   --276066
"魔刃 -- Felblade\n需要长柄武器，法杖，双手斧，双手锤，双手剑\n造成230%武器伤害附加1的暗影烈焰伤害。释放混乱箭和邪能顺劈斩会减少魔刃的冷却时间4秒。\n魔刃使用嗜血修正值。",   --276067
"溃烂打击 -- Festering Strike\n一次溃烂攻击，使下一次近战攻击造成瘟疫伤害，伤害提高为(PL-10)*1.5+20)。增加流血伤害的效果也会增加武器伤害。\n这使用重殴修正值。",   --270357
"火焰风暴 -- Fire Storm\n召唤火焰雨，对范围内敌人在8秒内造成268点火焰伤害。\n使用火焰之雨的修正值。",   --281840
"火焰奔腾 -- Flame Surge\n对目标及10码范围内的10个敌人造成85至99点火焰伤害，如果目标受到献祭效果影响，额外造成21.25至24.75点火焰伤害。\n使用烧尽的修正值。",   --281730
"火焰爆发 -- Flameburst\n召唤火柱，烧毁范围内所有敌人，造成32至42点火焰伤害，并额外造成10秒内50点额外火焰伤害。使用烈焰风暴的修正值。",   --283012
"闪光打击 -- Flare Strike\n揭示目标区域内8码范围的所有隐形敌人，持续5秒。到期时，将释放箭雨，造成(PL*4+0)+(SP*1.05)+(RAP*1.05)点物理伤害。\n使用乱射技能的修正值。此伤害对受猎人印记的目标翻倍。",   --283151
"强效之冲 -- Focused Burst\n需要远程武器\n向目标集中发射导弹，造成130%武器伤害加上9点额外伤害。后续的发射，伤害减少10%。\n使用多重射击的修正值。",   --284079
"冻结之光 -- Frozen Light\n需要主属性：精神\n注入单个盟友冰霜之光，使其受到你的冷冻治疗提高150%，并使你的其他治疗提高5%。",   --271315
"冰川尖刺 -- Glacial Spike\n召唤一根冰霜尖刺，造成119+(SP*0.129)+(AP*0.0838)点冰霜伤害，并使范围内敌人减速50%，持续4秒。\n超出战斗状态施放时冻结敌人4秒。\n使用冰锥术的修正值。",   --284177
"冰雹 -- Hailstorm\n寒冰碎片袭击目标区域，8秒内造成520点冰霜伤害。对玩家造成的伤害减少10%。\n使用暴风雪的修正值。",   --281800
"穷锤猛打 -- Hammer the Gap\n需要近战武器，单持单手武器\n破除目标护甲，造成70%武器伤害，每应用一次破甲效果，伤害增加5%。奖励1连击点数。\n使用毁灭打击修正值，威胁值较高。\n[破甲]:破除目标护甲，每层减少4%，可叠加至5层，持续30秒。\n与其他类似效果不叠加。",   --277019
"鬼魅痛击 -- Haunting Strike\n需要武器\n以暗影之力造成125%武器伤害，并使目标受到鬼魅痛击效果影响。\n使用还击修正值。\n[鬼魅痛击]:幻影之刃在目标周围徘徊，每3秒造成(PL*4.5+11)+(AP*0.06)+(SP*0.06)点暗影伤害，并减少你的鬼魅攻击冷却时间1秒。",   --285190
"灰白冰霜 -- Hoarfrost\n持续引导灰白冰霜，每秒对附近敌人造成95+(S*P0.08)+(AP*0.052)点冰霜伤害，降低其移动速度50%，持续3秒。如果已学会深冬之寒，则触发该效果。你每秒获得一层覆冰，达到10层将被眩晕。此技能使用地狱火修正值。",   --282887
"神圣惩戒 -- Holy Retribution\n在你周围引发一次高威胁的神圣光芒爆发，对附近敌人造成31至37点神圣伤害，同时治疗半径10码内的小队成员17至20点生命值。\n攻击强度增加伤害但降低法术治疗效果。\n此技能使用圣光新星修正值。",   --282234
"九头蛇毒液 -- Hydra's Venom\n需要武器\n攻击目标，造成40点自然伤害并施加中毒效果，额外造成0.25((MWB+mwb)/2+AP/14*MWS)（基于武器伤害）的伤害，持续15秒。\n此技能使用撕裂修正值，同时算作出血和毒药效果。",   --285897
"水柱 -- Hydricles\n发射一道冰霜箭，跳跃至4个附近敌人，造成(20)+(SP*0.58)+(AP*0.377)点冰霜伤害，并降低其移动速度15%，持续3秒。\n最大2层充能，8秒冷却时间。获得寒冰指将恢复一层。\n此技能使用寒冰箭的修正值。",   --284854
"冰霜猛击 -- Ice Lash\n需要单手近战武器\n用冰霜能量灌注你的副手武器，立即造成165%副手武器伤害的冰霜伤害。此伤害不受副手伤害修正影响，并且如果你的副手武器附魔为冰封武器，伤害增加25%。\n此技能使用熔岩猛击修正值，附魔为冰封武器时受到灵魂武器效果加成。",   --273561
"冰棱柱 -- Ice Prism\n将目标嵌入冰晶牢笼，每2秒造成(PL*7.2+-88)+(SP*0.1638)+(AP*0.1638)点冰霜伤害，持续12秒。\n此技能使用暴风雪修正值。",   --276467
"冰冷苦修 -- Icy Penance\n引导一波神圣冰霜之光，对敌人每秒造成142+(SP*0.58)+(AP*0.078)点神圣冰霜伤害，持续2秒。法术强度对伤害的提升在你的主属性是精神时加倍。\n此技能使用苦修的修正值。",   --271341
