"怒火新星 -- Ragefire Nova\n引导3秒，从你的活动火图腾中释放怒火，每秒对附近敌人造成(PL*0.3+1)+(SP*0.096)+(AP*0.0624)火焰伤害，并使其陷入狂怒灼伤状态。完全引导该法术会释放来自你的火图腾的火焰新星。\n此技能在变身状态下可用。",   --284958
