"暮光冲击 -- Twilight Shock\n立即对目标进行冲击，造成90+(SP*0.3748)+(AP*0.2436)的暮光伤害，并使目标每2秒受到5+(SP*0.08)+(AP*0.052)的伤害，持续6秒。\n使用暗影灼烧修正值。",   --283100
