"吸血鬼之咬 -- Vampiric Bite\n每3秒造成(103)+(SP0.1)+(AP0.065)的暗影伤害，并增加你对目标的致命一击几率3%。持续15秒。使用吸血之触修正值。此周期性伤害可以致命一击。",   --285759
