"电流之吻 -- Voltaic Bite\n立即咬向目标，造成175%武器伤害的风暴打击伤害。\n使用风暴打击的修正值。",   --277081
"水箭 -- Water Bolt\n向敌人投掷一道水箭，造成20至22点冰霜伤害。\n使用寒冰箭修正值。",   --272028
