"寒冬之风 -- Winds of Winter\n终结技，根据连击点对施法者正前方锥形范围内的敌人造成冰霜伤害：\n1点：2+30*1+(FroP*0.0096)*1*1+(AP*0.00624)*1*1-20+30*1+(FroP*0.0096)*1*1+(AP*0.00624)*1*1伤害；\n2点：2+30*2+(FroP*0.0096)*2*2+(AP*0.00624)*2*2-20+30*2+(FroP*0.0096)*2*2+(AP*0.00624)*2*2伤害；\n3点：2+30*3+(FroP*0.0096)*3*3+(AP*0.00624)*3*3-20+30*3+(FroP*0.0096)*3*3+(AP*0.00624)*3*3伤害；\n4点：2+30*4+(FroP*0.0096)*4*4+(AP*0.00624)*4*4-20+30*4+(FroP*0.0096)*4*4+(AP*0.00624)*4*4伤害；\n5点：2+30*5+(FroP*0.0096)*5*5+(AP*0.00624)*5*5-20+30*5+(FroP*0.0096)*5*5+(AP*0.00624)*5*5伤害。\n使用冰锥术修正值。",   --274121
"东泉吐息 -- Winterfall Firebreath\n施法者正前方锥形范围内的目标受到(119)+(SP*0.129)+(AP*0.0967)至(131)+(SP*0.129)+(AP*0.0967)的火焰伤害，并在接下来的6秒内每2秒受到额外的(22)+(SP*0.04)+(AP*0.026)火焰伤害。被击中的敌人减速30%。\n使用冰锥术修正值。此技能可在变形状态下使用。",   --284599
"无尽吸取灵魂 -- Unbounded Drain Soul\n吸取目标及其附近最多4个敌人的灵魂，每15秒造成60点暗影伤害。对血量低于25%的目标造成四倍伤害。\n使用吸取灵魂修正值。",   --281880
"荆棘爆裂 -- Burst of Thorns\n荆棘从你盟友的护甲中冒出，持续30秒，对附近的敌人造成伤害，并在受到攻击时获得荆棘之鳞。\n此技能在变身状态下可用。荆棘之鳞每8秒只能触发一次，伤害效果每秒只能触发一次。\n[荆棘之鳞]：增加1点护甲，并提高1点法力回复。持续5秒。",   --282195
"守护者之光 -- Light of the Guardian\n为友方目标治疗((PL-10)*4.875+42)+(Heal*0.24024)+(AP*0.048)点生命值，并对施法者8码范围内的敌人造成治疗量的70%的高威胁值伤害。\n可在躲避、格挡或招架攻击后使用。\n此技能使用圣光术修正值。",   --286025
"赫罗德的遗产 -- Herod's Legacy\n需要武器\n旋转起来，每秒对附近的6个敌人进行旋风攻击，持续7秒。在旋转期间无法移动或使用其他技能，且无法停止旋转。\n此技能使用旋风斩修正值。",   --284773
"骨刀 -- Bone Toss\n投掷一根骨头，弹跳至附近的2个敌人，造成((PL*3+4)+0.1*AP)+0.1*SP暗影打击伤害。\n此技能有很高的威胁值。",   --284920
"怨恨打击 -- Spiteful Strike\n需要匕首\n一次瞬时攻击，造成200%武器伤害加上PL*5+17。消耗你所有的怒气，每额外消耗100怒气减少3秒冷却时间。\n当狂怒边缘达到最大层叠时触发你的杀戮命令（如果已学会）。\n此技能使用英勇打击修正值。",   --276392
"无心之过 -- A Honest Mistake\n法术丢失现在使你的命中几率提高5%，法术急速提高5%，持续10秒。",   --284374
"快速死亡 -- A Quick Death\n使用“斩杀”现在可以让你获得快速死亡。\n[快速死亡]:近战急速增加3%。最多叠加5次，持续15秒。",   --283565
"痛苦之魂 -- Afflicted Soul\n吸取灵魂造成的伤害现在同样会造成折磨灵魂，达到15层后消耗，并造成破裂灵魂。\n[破裂灵魂]:你对目标造成的周期性暗影伤害增加25%。持续30秒。",   --275968
"萃取 -- Alembic\n当你受到近战或远程攻击时,有5％的几率回复20％的基础法力值。此效果每10秒最多触发1次。",   --283521
"阿曼萨加德的邪咒 -- Amal'thazad's Malediction\n使你的非周期性伤害技能或者法术有几率对目标施放阿曼萨加德的邪咒。\n[阿曼萨加德的邪咒]:对目标及其附近的目标造成((PL-10)*2+30)+(SP*0.2)+(AP*0.13)冰霜伤害，并且使其移速减少5%，最多叠加5次，持续6秒。",   --270832
"奥术之箭 -- Arcane Arrows\n你的猎人射击现在也发射奥术箭，造成(PL*0.3+1)+(SP*0.12)+(AP*0.078)额外的奥术伤害。",   --284901
"奥术神威 -- Arcane Divinity\n当神启激活时，你的奥术冲击和奥术飞弹被注入神圣之力，造成神圣伤害。",   --275462
"奥术枪手 -- Arcane Gunslinger\n自动射击和奥术射击现在使你获得奥术枪手效果。这个效果每2秒只能触发1次。\n[奥术抢手]:你的奥术弹幕额外攻击1个敌人，造成的伤害提高20%，并有25%的几率使你获得飞弹速射。效果最多堆叠4次，持续8秒或直到你获得飞弹速射。\n[飞弹速射]：使你下一个奥术飞弹的持续时间缩短2秒，法力消耗降低100%，飞弹每0.4秒发射一次。持续15秒。",   --274586
"奥术微粒 -- Arcane Motes\n你的奥术飞弹和奥术弹幕现在产生奥术微粒。\n[奥术微粒]:增加星火的伤害3%，月火的伤害5%。最多堆叠5次，持续8秒。",   --281905
"命运之盔 -- Armor of Faith\n对受到虚弱灵魂影响的目标施放强效治疗术或者快速治疗时为他们施加命运之盔，储存20%治疗量。当下次受到伤害时，治疗他们。\n治疗效果被玩家伤害触发时，效果减半。",   --282208
"冰霜巨人的问候 -- Arngrim's Greeting\n英勇飞跃现在给予你安格里姆的问候，并在落地时产生暴风雪，持续6秒。\n[安格里姆的问候]:加速你的施法，使你的施法速度提高20%，并使你在6秒内免疫中断和沉默机制。不与其他类似的施法速度提高效果叠加。",   --285843
"阿鲁高的闪现 -- Arugal's Blink\n在你到达的地方释放一波暗影箭，对附近的敌人造成(PL*10+54)+(SP*0.1)+(AP*0.065)暗影伤害。",   --285930
"阿鲁高的污染奥秘 -- Arugal's Tainted Arcanum\n奥术飞弹和暗影箭造成的伤害现在会产生污染。\n[污染]:使你对拥有不稳定痛苦的目标造成的伤害提高110%，痛苦诅咒提高190%。每次造成伤害消耗1层。最多10层效果，持续18秒。",   --275795
"星界融合 -- Astral Fusion\n星火术暴击现在重置星涌术的冷却时间并给予你星界融合。\n[星界融合]:使你的下一个星涌术的伤害提高50%，并减少34%的施法时间。最多堆叠3次，持续6秒.",   --274987
"赎罪 -- Atonement\n使用惩击，神圣之火和苦修造成的15%直接伤害现在治疗受到你的恩赐效果的盟友。\n伤害玩家时治疗效果降低50%。",   --270631
"自动开火 -- Automatic Firing\n当战斗降落伞结束时，你获得自动开火。\n[自动开火]:远程攻击速度提高50%，持续5秒。",   --272142
"闪电化身 -- Avatar of Lightning\n元素掌握不再使你瞬发法术和减少法力消耗，但是冷却时间缩短50%，并允许你在移动时施放闪电箭和链闪电。",   --283696
"沐浴鲜血 -- Bathe in Blood\n剔骨，毒伤，斩击和致命投掷的连击点数，现在每点有20%的几率让你在目标身上的每一次流血都获得沐浴鲜血效果。\n[沐浴鲜血]:你的流血伤害增加4%。剔骨和斩击造成的伤害增加2%。最多堆叠30次，持续9秒。达到最大层数时不能刷新持续时间。",   --275860
"战斗疲劳 -- Battle Fatigue\n你的战吼，旗帜和战嚎技能，现在对你10码内的敌人造成战斗疲劳。这个效果每30秒只能在战吼或旗帜下产生一次。\n[战斗疲劳]:增加你对目标造成的物理伤害10%。持续20秒.",   --272854
"战斗法师 -- Battlemage\n你的伤害性型战士技能现在有100%的几率触发奥术弹幕、火焰冲击或冰枪术。\n这个效果只能每4秒触发一次，并且不能从下一个技能触发。奥术弹幕、火暴和冰枪对玩家造成80%的伤害。",   --270272
"熊出没 -- Bear Attack\n这似乎没什么用。不过最好保持警惕。因为这就是熊的攻击，它们会在你最意想不到的时候出现。\n不能用于宠物。",   --281383
"仁慈远征军 -- Benevolent Crusader\n当你对盟友施放直接治疗技能时，使你获得1层仁慈远征军的效果。\n[仁慈远征军]:减少苦修、神圣之火、驱邪术和惩击的施法时间12%。最多叠加5次，持续6秒。",   --270235
"狂暴动力 -- Berserker's Momentum\n在拥有6层以上的古拉巴什狂战士效果时，狂怒打击有25%的几率在命中时，40%的几率在暴击时，将使破城者的冷却时间缩短10秒，使鲁莽的冷却时间缩短4秒。",   --275917
"狂野突袭 -- Bestial Assault\n直接伤害猎人技能现在有50%的几率使你获得狂野突袭。\n[狂野突袭]:达到5层可以恢复一次无情之怒。持续12秒。",   --272317
"刺骨严寒 -- Biting Cold\n当你的深度冻结造成伤害时，冷却时间减少33%。你的有施法时间的伤害法术使你获得刺骨严寒。\n[刺骨严寒]:使你下一次的冰枪暴击几率提高5%，伤害提高10%。最多叠加5次，持续15秒。",   --282134
"鲜血之刃 -- Blades of Blood\n使用冲锋或巨人打击会获得鲜血之刃。\n[鲜血之刃]:你的旋风斩现在可以额外击中5个目标并施加撕裂效果。持续3秒。",   --285895
"烈焰传播 -- Blaze\n火焰冲击引燃你的点燃效果，将其蔓延至10码范围内的敌人。蔓延的点燃效果无法造成暴击。",   --281749
"烈焰光环 -- Blaze Ward\n当你直接受到伤害或避开攻击时，有一定几率触发烈焰光环。\n[烈焰光环]：点燃你周围的区域，每秒对附近的所有敌人造成(PL*0.3+4)+(SP*0.05)+(AP*0.0325)的火焰伤害。持续5秒。产生大量威胁值。",   --283534
"炽热决心 -- Blazing Determination\n当你被非打断效果命中时，在不施放技能的情况下，使你免疫控制、击退、沉默和打断效果，持续6秒。此免疫效果仅在你施放技能时生效。\n该效果每30秒只能触发一次。",   --283619
"神圣与自然的祝福 -- Blessing of the Divines\n你的直接治疗技能现在有几率触发一个随机的祝福效果。每秒只能触发一次，只能从具有法力消耗的治疗技能中触发。\n泰坦的祝福：增加目标的生命值10%，并减少所受伤害10%，持续8秒。\n创造的祝福：为你和你的小队提供((PL*1.2)+11)点法力值，22点能量和10点怒气。\n时间的祝福：增加你和目标的急速属性10%，持续10秒。\n愈合的祝福：治疗你身边30码范围内的小队成员，治疗量为((PL-10)*5.5+11)+(Heal*0.16)+(AP*0).\n神圣的祝福：治疗你身边30码范围内的小队成员，每3秒治疗一次，治疗量为((PL-10)*4.5+11)+(Heal*0.06)+(AP*0)，持续15秒。",   --273020
"致盲消失 -- Blinding Dispersion\n消散的冷却时间减少10秒。当消散结束时，一个暗影新星会使附近的敌人盲目并迷失方向2秒。",   --283428
"眨眼就错过了! -- Blink and you'll miss it!\n你的有施法时间的伤害法术现在使闪烁的冷却时间缩短1秒。\n这个效果每秒只能产生一次，并且只对生物有效。",   --272185
"放血 -- Bloodletting\n对因撕裂而流血的目标使用割裂会触发一次猛烈攻击，造成60%的武器伤害，并对10个附近的敌人施加撕裂，但撕裂现在有5秒的冷却时间。",   --283986
"血腥漩涡 -- Bloody Maelstrom\n消耗漩涡武器现在会使你的下一次嗜血或致死打击对附近6名敌人造成(PL*0.88+2)+(SP*0.44)+(AP*0.44)元素伤害。",   --284252
"茁壮成长 -- Blooming Growth\n愈合的暴击治疗效果，会持续治疗目标周围的3个小队或者团队成员。",   --272214
"炸弹人 -- Boomer\n直接伤害火系法术有几率在你周围引起爆炸，造成（（PL-10）*2+2）+（SP*0.0812）+（AP*0.125）的伤害，并使你的法术暴击几率提高3%，持续5秒。\n该效果每8秒只能出现一次。",   --281369
"膨胀闪电 -- Booming Thunder\n使用闪电箭或连锁闪电造成伤害时，以及消耗回响天赋BUFF时，为你提供膨胀闪电。元素冲击可叠加4层。\n膨胀闪电\n使你下一次大地震击的伤害提高15%，并使其关键打击的伤害加成提高2%。最多可叠加20次，持续15秒。",   --272585
"积聚的渴望 -- Built up Thirst\n每激活一个连击点，你的嗜血就会多造成5%的伤害。",   --271778
"爆裂火焰 -- Burst of Flames\n使用腐蚀术，燃烧，献祭和暗影烈焰造成周期性伤害现在可以获得燃烧术士点燃效果。\n[燃烧术士点燃]:你的下一个火焰冲击波对目标造成的伤害提高10%。最多叠加5次，持续6秒。",   --274640
"连发射击 -- Burst Shot\n施放黑箭、爆炸射击、奇美拉射击或瞄准射击现在也会向目标发射连发射击，造成(PL-20)*0.7+30%的远程武器伤害为火焰。\n使用黑箭，活体炸弹和毒蛇钉刺造成伤害有33%的几率触发爆发射击。\n使用火焰冲击的修正值。",   --271127
"中心 -- Centered\n你的直接神圣治疗现在使你获得中心效果。\n[中心]:你的惩击、神圣之火和苦修造成的伤害增加2%，命中几率增加3%。可以叠加5次，持续10秒。",   --284380
"混乱鞭笞 -- Chaos Lash\n离得混乱箭现造成伤害时产生混乱燃烧，并且现在可以触发反冲。\n[混乱燃烧]:增加反冲25%触发几率。最多堆叠4次，持续10秒。",   --285620
"净化叛教者的火焰 -- Cleansing Flames of the Apostate\n需要[烧灼之火](CauterizingFire)\n用烧灼之火治疗获得叛教者的火焰。\n[叛教者的火焰]:在下次施放这些法术时赋予其力量，最多堆叠3层，持续12秒\n-神圣之火:治疗附近的盟友(PL*3.38+1)+(SP*0.1625)+(AP*0.032)，额外击中1个目标，并延长持续时间2秒。\n-烈焰风暴:持续时间增加2秒，施法时间减少34%。\n-光晕:增加20%的治疗效果，每个被治疗的盟友释放一个火焰之圈，对3个附近的敌人造成(PL*3.5+20)+(SP*0.2)+(AP*0.13)辐射伤害。",   --271210
"集体意识 -- Collective Conscious\n你的宁静现在治疗时也恢复15%的基础法力值。",   --282029
"导体 -- Conductor\n使用寒冰箭造成伤害现在使你成为导体。寒冰箭暴击和冰霜新星给予你2层导体效果。\n[导体]:减少你的下一个闪电箭或闪电链的施法时间34%，增加你触发闪电过载的几率25%，并且提升60%的造成伤害。最多堆叠3次，持续10秒。",   --272058
"神圣打击 -- Consecrated Strikes\n你的十字军打击，神圣风暴和正义之锤现在有50%的几率创造圣地。\n[圣地]:对敌人造成(PL*0.5+3)+(SP*0.04)+(AP*0.04)每秒的神圣伤害，并使该区域内的盟友增加5%的力量持续8秒。",   --272475
