"狂野精灵之火 -- Fervent Faerie Fire\n当你对敌人完全施放割裂时，你获得大自然的热情。\n[大自然的热情]:使你的下一个法术:精灵之火(野性):使你受到的物理伤害降低10%，持续8秒。",   --272289
"溃烂 -- Festering Wound\n你的毁伤暴击现在给与你溃烂效果。\n[溃烂]:使你对目标造成的自然伤害提高2%。最多可叠加6次，持续12秒。",   --272553
