"炽热的激情 -- Fiery Fervor\n在防御姿态，正义之怒，或法力壁障状态下，造成直接神圣和火焰伤害现在有30%的几率给予你炽热的激情。\n[炽热的激情]:减少8%的伤害。持续10秒。",   --272088
