"与火同行 -- Fire Walk With Me\n你的烈焰风暴现在使穿过它的盟友的移动速度提高50%。",   --283296
"引燃 -- Fired Up\n当你的火焰法术和技能造成的直接伤害时，有12％的几率使你下一个火焰法术或技能必定爆击。",   --283634
"燃烧吧 -- Flame On!\n你的火球，灼烧和烈焰风暴使你获得燃烧吧。另外，你的火焰冲击波的射程增加5码。\n[燃烧吧]:使你的下一个火焰冲击或流星的暴击几率提高15%，并使其伤害提高35%。",   --272396
"闪电飓风 -- Flash Hurricane\n使用飓风造成伤害会使你获得闪电飓风。此效果只能每1秒发生一次。\n[闪电飓风]:你的直接治疗产生闪电飓风，对附近的敌人造成(PL*3+15)+(SP*0.15)+(AP*0.0975)自然伤害。最多可储存5次，持续12秒。",   --286352
