"流动 -- Flowing\n施放治疗之触现在使你获得流动效果。达到4层会给你溢出效果。\n[满溢]:使你下一次治疗链的治疗效果提高50%。持续15秒。",   --273418
"叉状闪电 -- Forked Lightning\n使你的闪电链在每次命中目标时产生额外的叉状闪电。",   --281363
"寒冰巫妖 -- Frost Lich\n伤害性技能有一定几率冻结你的目标，造成冰霜伤害并使其减速50%，持续4秒。\n此效果每9秒只能产生一次",   --273191
"圣光之怒 -- Fury of the Light\n当神启激活时，你的奥术和神圣法术暴击加成提高40%。",   --275463
"花园成长 -- Garden of Growth\n你的治疗之触暴击现在给予盟友花园成长。\n[花园成长]:达到3层时，在你的盟友身上种植一颗活力种子，并在不消耗它们的情况下在10码范围内绽放所有活力种子。可以叠加3次，持续30秒。",   --282188
"暗影拥抱 -- Gloaming Embrace\n施放暗影之舞现在对8码内的所有敌人施加5个暗影标记。伏击共计一个暗影标记的目标使你获得暗影拥抱。\n[暗影拥抱]:使所有伤害提高4%。最多叠加5次，持续15秒。",   --272808
"戈德林的专注 -- Goldrinn's Focus\n你的终结技现在每点连击点有4%的几率给予你戈德林的专注。当戈德林的诡计激活时，使用心灵震爆或吸血鬼之触会使你获得戈德林的专注。对无尽精神鞭笞无效。\n[戈德林的专注]:使你下一次心灵鞭笞的伤害提高80%或下一次心灵灼烧的伤害提高20%，并使施法时间减少25%。最多叠加3次，持续14秒。",   --275752
"贪婪诅咒 -- Grasping Curse\n你的暗影箭伤害现在造成贪婪诅咒。此效果每5秒只能触发一次。\n[贪婪诅咒]:降低目标35%的移动速度，持续5秒。",   --283238
"林间游侠 -- Grove Ranger\n使用猎人射击现在使你获得林间游侠。\n[林间游侠]:你的下一个野性生长额外治疗1个目标，治疗半径增加5码。治疗之触和愈合最多消耗2层，每消耗一层减少50%的施法时间。",   --276890
"林间游侠的敏捷 -- Grove Ranger's Agility\n提高你的敏捷的100%的远程攻击强度，敏捷的20%转变为治疗强度。",   --276896
