"圣光成长 -- Growing Light\n当对受圣光道标影响的目标施放圣光术时，使你治疗目标附近8点码内最多3名友方目标，相当于此次圣光术治疗量的20%。",   --270661
"丛林守卫 -- Guardians of the Grove\n你的树人现在使用你所有已知的德鲁伊治疗法术治疗生命值低于90%的盟友，除了宁静，但不再造成伤害，他们的生命值减少66%。\n在战场或竞技场，树人只使用瞬发的德鲁伊治疗法术",   --270495
"古拉巴什狂战士 -- Gurubashi Berserker\n狂怒打击，猛击，破城者和斩杀的暴击现在会让你获得狂战士。\n[古拉巴什狂战士]:减少你的战士技能的公共冷却时间3%，但增加他们的怒气消耗3%。最多堆叠10次，持续14秒。",   --275914
"祝福之锤 -- Hammerdin\n施放伤害性圣骑士技能有20%的几率召唤天堂之锤，并使审判之时的冷却时间缩短3秒。\n[天堂之锤]:神圣之锤从天而降，对附近敌人造成((PL-30)*1+2)+(AP*0.07)+(SP*0.07)至((PL-30)*1+21)+(AP*0.07)+(SP*0.07)神圣伤害。",   --282983
"驾驭能量 -- Harnessed Energy\n你的奥术冲击减益效果被驾驭能量所取代。\n[驾驭能量]:使你的下一个奥术法术伤害提高25%，并使奥术冲击的法力消耗提高400%。最多可以叠加5层，持续10秒。奥术冲击不消耗层数。",   --283730
