"神圣光辉 -- Holy Radiance\n你的强效治疗和快速治疗现在对所有受你的恢复效果影响的盟友触发神圣光辉。\n[神圣光辉]:强效治疗的效果提升25%或快速治疗的效果提升40%。",   --272988
"神圣粉碎 -- Holy Shatter\n神圣法术的暴击会使你的冰棱镜目标粉碎，对附近5个敌人造成(PL*4+-47)+(SP*0.21444)+(AP*0.21444)冰霜伤害。此伤害必暴击。\n使用冰锥术的修正值。",   --276466
"神圣之灵 -- Holy Spirit\n用苦修治疗队友或者伤害敌人会给你圣灵效果。\n[圣灵]:使你下一次神圣震击的暴击几率和治疗效果提高20%。最多叠加4次，持续10秒。",   --273920
"重装步兵 -- Hoplite Training\n重步兵训练可以让你同时使用长柄武器和盾牌。\n对泰坦之握无效的效果同样队重装步兵无效。",   --274267
