"毁灭边缘 -- Impending Doom\n你的心灵震爆和暗言术:灭现在使你获得毁灭边缘。\n[毁灭边缘]:你接下来的5次周期性暗影伤害造成的伤害增加20%。对玩家造成的伤害增加15%",   --283848
"恢宏连击 -- Imposing Combo\n这些技能现在消耗连击点，增加他们的仇恨值，并给予你2秒的增益，每连击点额外增加2秒持续时间:\n-神圣风暴使你的护甲增加5%\n-胜利冲刺使你的最大生命值提高5%\n-风暴打击使你受到的伤害降低3%",   --285598
"影随之根 -- Inescapable Roots\n你的纠缠根须和群体缠绕会阻止目标使用任何能打破它的法术或技能，此效果为根须持续时间的一半。然而你的纠缠根须更容易因受到伤害而破坏。",   --284057
"地狱火 -- Inferno\n被你的地狱烈焰击中的敌人现在有一定几率触发一次额外的地狱火爆炸。",   --284833
"无尽燃烧 -- Infinite Burn\n使用混乱箭，烧尽，灼热之痛和灼烧造成伤害现在会给予你无尽燃烧。\n[无尽燃烧]:你的下一个燃烧不消耗献祭。持续10秒。",   --270426
"能量注入 -- Infused Energy\n你的直接伤害法术赋予你能量注入.\n[能量注入]:下1个消耗能量值的技能的直接伤害提高15%，能量消耗降低15点。最多可以叠加3层，持续12秒。",   --284098
