"冻结熔岩 -- Lava Freeze\n用熔岩打击造成伤害现在会使你获得冻结熔岩。\n[冻结熔岩]:使冰枪和冰锥术的伤害提高20%，使寒冰箭和深度冻结的伤害提高5%。最多叠加3次，持续15秒。",   --273560
"古神之跃 -- Leap of the Old Gods\n你的英勇飞跃现在会让你获得上古之神的疯狂，并产生攻击附近敌人的触手，持续20秒。\n[上古之神的疯狂]:增加5%的魔法伤害。持续15秒。",   --284808
