"生命之环 -- Life Circle\n快速治疗和强效治疗术使光晕的冷却时间缩短4秒，治疗之环和愈合祈祷使其冷却时间缩短3秒。",   --271486
"倾泻闪电 -- Lightning Discharge\n施放闪电箭或闪电链时，你的闪电之盾造成双倍伤害并释放能量，使附近的敌人昏迷2.5秒。\n此效果每20秒只能产生一次。",   --283317
"蝗灾游侠 -- Locust Ranger\n需要[急速抽箭]\n当稳固射击击中被你的毒蛇钉刺的目标时，它会触发你的急速抽箭天赋。",   --271746
