"月光轰炸 -- Lunar Bomber\n当你获得月食(月)时，你也会获得月光轰炸，使你的星火术和星涌术获得太阳火焰。\n[太阳火焰]:增加火球术和炎爆术的伤害15%。最多叠加5次，持续18秒。",   --275015
"月光骑士 -- Lunar Knight\n当月食(月)激活时，邪恶攻击现在赋予你月光骑士。\n[月光骑士]:使你的下一个星火术的伤害提高50%。最多叠加2次，持续6秒。",   --274558
"月灵 -- Lunar Spirits\n你的奥术飞弹攻击受你的月火影响的敌人，对附近10码内的3个敌人释放月灵。\n[月灵]:每3点燃烧敌人造成(PL*0.85+4)+(SP*0.0845)+(AP*0.0549)奥术伤害，共9秒。",   --282353
"夺取魔法 -- Mana Reave\n使用近战技能造成的伤害会恢复你已损失的4%法力值。\n每5秒只能触发一次，并且只能在触发公共冷却的技能触发。",   --270046
"武术强化 -- Martial Crescendo\n每个独立的直接伤害物理技能使你获得1层武术强化效果。\n[武术强化]:提高你的攻击速度5%。最多堆叠10次，持续6秒。造成魔法伤害会重置所有堆叠。",   --271051
"大屠杀 -- Massacre\n你的杀戮盛宴现在也会对所有被击中的目标施加大屠杀效果。\n[大屠杀]:增加你对目标造成的伤害3%，最多叠加5次，持续15秒。",   --283139
"暗影大师 -- Master of Shadows\n现在，使用邪恶攻击和忧郁之刃的直接致命一击将授予你暗影学徒。\n[暗影学徒]:使用割裂和剔骨消耗3层即可获得暗影大师。最多叠加3次，持续8秒。\n[暗影大师]:暗影伤害提高30%，暗影法术致命一击几率提高10%。持续10秒。",   --275491
"精通急速 -- Mastery of Haste\n元素掌握现在还会使你的近战急速提高20%。",   --274088
"修葺之潮 -- Mending Tide\n激流现在适用修葺之潮。修葺之潮一次只能影响一个目标。\n[修葺之潮]:每两秒治疗目标和8码内5名附近盟友，持续((PL-19)*3.16+64)+(heal*0.02413)+(AP*0.005)，持续6秒。",   --272657
"午夜烈焰 -- Midnight Flames\n使用火球术、火焰冲击和炎爆术造成直接伤害现在会施加午夜烈焰。\n[午夜烈焰]:你的献祭对目标造成的伤害提高12%。最多可叠加5次，持续12秒。大火会消耗该效果。",   --274642
"熔岩大地 -- Molten Earth\n你的熔岩猛击会在地面上释放熔岩大地。\n[熔岩大地]:燃烧区域内的敌人，每秒造成((PL-19)*1.45+0)+(SP*0.06)+(AP*0.039)点火焰伤害，持续6秒。\n使用火焰新星修正值。:",   --272623
"熔岩爆发 -- Molten Outburst\n在地震中对敌人施放火焰法术造成伤害会导致喷发，对附近敌人造成(PL*2+2)+(SP*0.2)+(AP*0.13)点火焰伤害，并将玩家击飞。\n该效果每10秒只能发生一次。",   --283471
"凡人之殇 -- Mortal Wounds\n如果目标生命值高于50%，你的致死打击现在会使目标减慢25%，持续4秒。\n不与其他类似效果叠加。",   --282322
"死灵法师之触 -- Necromancer's Touch\n你的主宰亡灵或奴役恶魔宠物的技能伤害现在会使目标感染死灵法师之触。\n[死灵法师之触]:下一次吸取生命对目标造成的伤害提高25%，血箭对目标造成的伤害提高3%。最多叠加10次并持续8秒。",   --275963
"光明之王 -- One With The Light\n牺牲你的肉身，减少50%的物理伤害，增强你的十字军打击和神圣风暴，使它们造成额外的神圣伤害，并获得额外的神圣能量缩放。\n该效果可以打开和关闭。",   --275358
"日蚀预兆 -- Oracle's Eclipse\n圣光现在激活日蚀预兆（月），治疗波激活日蚀预兆（日）。两种效果不能同时发生，每种效果只能每30秒发生一次。当你学会日蚀预兆的时候，无法从其他月蚀效果获得增益。\n[日蚀预兆（日）]:在日食期间，圣光术的治疗效果会提高15%，并且会受益于最高级的先祖复苏天赋，如果你已经是最高级。\n[日蚀预兆（月）]:在月食期间，治疗波的治疗效果会提高15%，并且会从神圣庇护天赋中获益，如果你已经是最高级。",   --275273
"溢出 -- Overflow\n你的直接自然治疗现在还可以治疗8码内的额外小队或团队成员，治疗效果为治疗效果的30%。",   --273415
"溢出栽培 -- Overflowing Cultivation\n你的溢出现在也会导致治疗链产生生命之种的效果。",   --273422
"过热的罢工 -- Overheated Strikes\n你的武器过热，导致你的近战技能现在造成额外15%的武器伤害，加上1+0.01*AP+0.01*SP作为火焰伤害。",   --270082
"超载精通 -- Overload Mastery\n你的闪电箭和闪电链有11%的几率对目标立即施放第二次，造成一半伤害。这也可能由闪电过载和类似效应触发。",   --281411
"心灵超载 -- Overloaded Mind\n现在，造成直接自然或冰霜伤害会让你超载，达到10层会让你获得精神超载。\n[精神超载]:使你的法术急速提高10%。持续10秒。",   --270110
"光之典范 -- Paragon of Light\n现在，用惩击和神圣之火造成直接伤害会让你获得光之典范。\n[光之典范]:使你的法术致命一击几率提高1%。最多可叠加10次，持续10秒。",   --273748
"疫病 -- Pestilence\n你施展的邪恶攻击和忧郁之刃会将你的腐蚀术传播到目标周围10码内的敌人。\n腐蚀术不会蔓延到被控制的玩家或图腾。",   --281492
"方阵打击 -- Phalanx Strike\n需要[长柄武器当]\n血性狂暴激活时，你的邪恶攻击现在会为你提供方阵打击。\n[方阵打击]:邪恶攻击伤害增加20%，能量消耗减少5点。最多叠加5次，持续15秒。清爽的血性狂暴会清除所有层数。",   --274318
"密集打击 -- Pious Strikes\n你的正义之锤和复仇者之盾会在击中第一个目标时释放密集打击。\n[密集打击]:光从目标处爆炸，对敌人造成((PL-20)*6.6+31)+(SP*0.0848)+(AP*0.0551)点神圣伤害，并对敌人造成((PL-20)*2+30)+(SP*0.0848)+(AP*0.0551)对10码内的盟友进行神圣治疗。\n这使用神圣新星修正值并且不会造成威胁。",   --282014
"瘟疫熊人 -- Plague Bearer\n用裂伤（熊）造成的伤害现在会产生狂犬病。\n[狂犬病]:目标受到的所有来源的物理伤害提高(PL*0.5+0)，你的熊技能造成的伤害提高5%，并使你对它们造成暴击的几率提高10%。持续15秒。",   --270354
"碾压之力 -- Power Overwhelming\n现在，使用奥术飞弹或奥术冲击造成伤害时，奥术能量的冷却时间会减少2秒，气定神闲的冷却时间会减少1秒。",   --283578
"悔罪者祷言 -- Prayers of the Penitent\n苦修后立即施放治疗祷言现在会释放苦修导弹，弹回4个附近的敌人。\n该效果每6秒只能发生一次。",   --285632
"准备粉碎！ -- Prepared to Crush!\n现在，达到重压最大堆叠数即可让您开始攻击。\n[准备罢工]:你的下一次近战挥击会对你面前的敌人造成致命一击，造成330%的武器伤害。\n此武器伤害是非正常的。对玩家造成110%的非暴击伤害。",   --273386
"保存 -- Preservation\n治疗祷言现在也给予盟友保存。\n[保存]:你对该盟友的下一次治疗暴击效果几率提高20%。持续10秒。",   --276273
"原始狂乱 -- Primal Frenzy\n使用撕扯和斜掠造成伤害现在有10%的几率激怒你，使猎豹形态技能的能量消耗降低25%，并使你造成的伤害提高5%。持续10秒。",   --283541
"原始余震 -- Primordial Aftershocks\n你的元素冲击和熔岩爆裂暴击现在可以减少萨满震击的冷却时间6秒。",   --276600
"原生之怒 -- Primordial Fury\n当萨满狂怒激活时，你的直接伤害技能和法术的致命一击现在会使用你最大怒气的50%来造成85%武器伤害+2+(SP*0.13)+(AP*0.0845)元素伤害。",   --273488
"原生暗影 -- Pure Shadow\n施展暗影箭、暗影灼烧和暗言术：灭会从你的敌人那里汲取力量，赋予你原生暗影。\n[原生暗影]:暗影法术的暴击率提高1%，暗影箭的伤害提高1%。最多堆叠10次，持续18秒。",   --273453
"净化之光 -- Purification By Light\n你的直接伤害法术和技能现在有一定几率驱除目标，造成(PL*3.5+26)+(SP*0.09)+(AP*0.09)点神圣伤害并圣化其下方的地面，造成(PL*1+4)+(SP*0.05)+(AP*0.0325)每秒对范围内的敌人造成神圣伤害，持续8秒。\n使用了驱邪术和奉献修正值。",   --270766
"热解 -- Pyrolysis\n使用炎爆术造成伤害会刷新你的腐蚀术持续时间，并赋予你临界灵魂之火。\n[临界灵魂之火]:10秒内灵魂之火的暴击率提高10%。",   --271544
"叛教者之焰 -- Raging Flames of the Apostate\n用火球或灼烧之火造成伤害现在有50%的几率为你提供叛教者之焰。\n[叛教者之焰]:下次施放这些法术时赋予其力量。最多叠加3层，持续12秒。\n-圣火治疗附近盟友(PL*3.38+1)+(SP*0.1625)+(AP*0.032)，额外命中1个目标，持续时间增加2秒。\n-烈焰风暴的持续时间增加2秒，施法时间减少34%。\n-治疗之环的治疗效果提高20%，每个受治疗的盟友都会释放一个火焰之环，造成(PL*3.5+20)+(SP*0.2)+(AP*0.13)对附近3名敌人造成光辉伤害。",   --271204
"准备拆除！ -- Ready to Demolish!\n消耗最大层数的毁灭可以增强你的下一个能力：\n-破甲攻击：使你的护甲穿透力提高30%，持续20秒。\n-还击：额外奖励2点连击点，并额外降低目标攻击速度10%。\n-猫鼬撕咬：不触发任何冷却时间，造成的伤害提高100%，并且保证造成暴击。",   --273801
"无情裂伤 -- Relentless Laceration\n你的割伤可以额外叠加2次，并且其持续伤害效果现在受益于近战急速。",   --282019
"无情的处决 -- Remorseless Execution\n用斩杀造成伤害现在会让你变得无情。\n[无情]:使你的下一次邪恶攻击、背刺、毁伤、伏击、出血或鬼魅攻击的暴击率提高20%。",   --273891
"恩赐重生 -- Renewed Through Absolution\n苦修现在消耗你的恢复来治疗你的目标额外的((PL)*6+86)+(治疗*0.1)+(AP*0.02)。\n使用苦修治疗修正值。",   --272989
"正义光辉 -- Righteous Radiance\n现在，用火焰法术造成直接伤害会赋予你正义光辉，并使目标的正义之火持续时间增加1秒。\n[正义光辉]:叠加5层后，你的圣火现在对8码内的5个敌人造成光辉伤害，并用正义之火燃烧他们，在7秒内造成额外光辉伤害。每击中一个敌人即可恢复10点心灵之火。",   --270326
"公证狂热者 -- Righteous Zealot\n你的伤害性法术和技能现在有100%的几率惩击你的目标，造成((PL*2.12)+13)+(SP*0.1275)+(AP*0.1275)点额外神圣伤害，并治疗附近的队友，持续((PL*1.137)+20)+(heal*0.1275)+(AP*0.1275)。\n该伤害使用惩击修正值并且每4.5秒只能发生一次。对敌方玩家触发时造成80%的伤害和治疗。",   --273121
"焦土 -- Scorched Ground\n当你的活动炸弹爆炸时，它会烧焦地面，燃烧该区域内的敌人8秒。\n使用烈焰风暴的修正值，并且每8秒只能发生一次。",   --283200
"生命之种 -- Seed of Life\n愈合和回春术治疗现在会在盟友身上植入生命之种。\n[生命之种]:每秒治疗(PL*0.02+2)+(治疗*0.00053625)+(AP*0)并使目标身上的生命绽放治疗效果提高40%。最多可叠加8次，持续10秒。",   --273346
"沸腾之火 -- Seething Flames\n你的伤害技能现在有30%的几率点燃目标，在2秒内对附近敌人造成(PL*0+10)+(SP*0.019)+(RAP*0.019)点火焰伤害3次。\n使用爆炸射击的修改值。",   --270865
"暗影崩溃 -- Shadow Crash\n当原生暗影达到最大层数时，你的暗影之怒现在还会导致原生暗影在目标区域坠落，造成(PL*32+2)+(AP*2.275)+(SP*3.5)点暗影伤害，在敌人之间扩散在该地区的。",   --273458
"死亡阴影 -- Shadow of Death\n施放暗影步现在可以增强你的下一次伏击，使其触发死亡之影。\n[死亡阴影]:对附近敌人造成((PL*1)+4)+(SP*0.035)+(AP*0.07)点暗影伤害。\n使用伏击的修正值。",   --272816
"帝王之盾 -- Shield of the Emperor\n你的盾牌猛击和正义炖鸡现在有10%的几率授予你皇帝下凡。\n[皇帝下凡]:成为不可阻挡的巨像，持续3秒，造成的物理伤害提高15%，受到的伤害降低30%。您的移动速度设置为80%。你不能被固定或受到移动速度效果的影响。\n这使用天神下凡的修饰值。",   --284794
"风暴护盾 -- Shielding Storm\n当风暴之锤处于活动状态时，使用风暴之锤现在将为您提供风暴之盾。\n[风暴之盾]:使你的法术伤害提高，基于30%的耐力，并减少受到的伤害12%。持续15秒。",   --273961
"丸粒织造 -- Shot Weaving\n在飞弹速射激活时施放奥术飞弹会将射击与法术交织在一起，每发奥术飞弹发射一次远程射击，造成(PL*2+1)+(SP*0.34)+(RAP*0.34)点物理伤害。\n当你的主要属性是敏捷时，你的飞弹速射会加速40%。",   --274591
"界面旋涡 -- Sinister Flurry\n你的邪恶攻击有几率触发额外攻击，造成50%的武器伤害，并额外获得连击点。",   --283559
"倾注恶兆 -- Sinister Transfusion\n使用生成连击点的技能造成伤害现在会授予你的驯服宠物倾注恶兆。驯服宠物包括召唤恶魔、奴役恶魔、支配亡灵、驯服龙类或元素束缚和驯兽。\n[倾注恶兆]:使你驯服的宠物的伤害提高15%，并每2秒恢复1%总法力或10点能量，持续8秒。\n与恶魔渗透同时使用时持续时间减少50%。",   --284198
"太阳轰炸 -- Solar Bomber\n当你获得日食（太阳）时，你还会获得太阳轰炸，使你的火球术和炎爆术为你提供月之火焰。\n[月之火焰]:星体耀斑和星体电浆伤害提高15%。最多可叠加5次，持续18秒。",   --275014
"日蚀骑士 -- Solar Knight\n当日食（太阳）处于活动状态时，使用邪恶攻击现在会授予你太阳骑士。\n[日蚀骑士]:使你的下一次愤怒的伤害提高50%。最多叠加2次，持续6秒。",   --274557
"灵魂恢复 -- Soul Restoration\n对盟友施放圣光术、强效治疗、治疗波或治疗之触会减少其灵魂虚弱的持续时间2秒。",   --282213
"虹灵魂吸 -- Soul Siphoner\n你的鬼魂现在还能治愈3名生命值最低的队伍或团队成员。",   --281911
"灵魂虚空 -- Soul Void\n使用吸取灵魂造成伤害现在会应用灵魂虚空。达到10层后会造成枯萎灵魂，使你的吸取生命将目标生命值多转移25%给你，持续10秒。\n枯萎灵魂的敌人不会获得灵魂虚空。",   --277143
"左撇子攻击 -- Southpaw Strike\n使用嗜血、斩杀和撕裂现在可以用副手触发一次即时攻击，造成220%的武器伤害，并赋予你左撇子。此效果每16秒只能发生一次，且左撇子不能与优势（左右开弓）同时激活。\n[左撇子]:使副手武器造成的伤害提高40%，持续9秒。",   --273597
"法术风暴 -- Spellstorm\n消耗飞弹速射现在为您提供奥术诱发，消耗思维冷却为您提供火焰诱发。\n[奥术诱发]:触发下一次思维冷却的几率额外增加60%。持续10秒。\n[火焰诱发]:触发下一个飞弹速射的几率额外提高60%。持续10秒。",   --271709
"灵霜 -- Spirit Frost\n\n使用冰箭或冰枪造成伤害会赋予你灵霜。\n[灵霜]:快速治疗、强效治疗和治疗祷言消耗最多2层，使施法速度降低50%。灵霜强化的苦修现在可以治疗附近的盟友。通道结束时消耗1层。最多堆叠5次，持续15秒。",   --271323
"精神苦行 -- Spirited Penance\n苦修的引导时间增加25%，使其能够发射额外的箭矢。",   --273924
"破碎的混沌 -- Splintered Chaos\n施放烈焰现在将为你提供混沌碎片和寒冰指。\n[混沌碎片]:你的混沌箭会额外击中1个附近的敌人，并且每击中一个目标就会给你冰冻余烬。\n[冰冻余烬]:你的混乱碎片现在额外击中1个目标。最多可堆叠10个并持续7秒。\n[寒冰指]:你的法术将目标视为冰冻状态。持续15秒。",   --275617
"扩散棱镜 -- Spreading Prism\n使用冰锥术或冰箭造成伤害会刷新冰棱柱的持续时间并将其传播到附近的5个敌人。",   --276471
